            <img className='user-card-avatar' src={user.avatarUrl} alt="avatar" />
            <div className="user-info">
            <div className="user-card-name">
            <p>{user.firstName}</p>
            <p>{user.lastName}</p>
            <p>{user.userTag}</p>
            </div>
              <p className="user-card-department"><span>{user.department}</span></p>
              {}
            </div>
           
     
          </div>
      )
 
    
      })}
    </div>
  );
};

